import React, { useState, useEffect, useRef} from "react";
import axios from "axios";
import "./Register.css";

const App = () => {
    const userRef = useRef();
    const errRef = useRef();

    const [user, setUser] = useState('');
    const [validName, setValidName] = useState(false);
    const [userFocus, setUserFocus] = useState(false);

    const [pwd, setPwd] = useState('');
    const [validPwd, setValidPwd] = useState(false);
    const [pwdFocus, setPwdFocus] = useState(false);

    const [matchPwd, setMatchPwd] = useState('');
    const [validMatch, setValidMatch] = useState(false);
    const [matchFocus, setMatchFocus] = useState(false);

    const [phoneNumber, setPhoneNumber] = useState('');


    const [errMsg, setErrMsg] = useState('');
    const [success, setSuccess] = useState(false);

    useEffect(() => {
        userRef.current.focus();
    }, []);
    useEffect(() => {
        setValidName(user.length < 6);
    }, [user]);
    useEffect(() => {
        setValidPwd(pwd.length < 6);
    }, [pwd]);
    useEffect(() => {
        setValidMatch(matchPwd !== pwd);
    }, [matchPwd]);


  const handleSubmit = async (e) => {
    e.preventDefault();

    if (
      validUsername ||
      validPassword ||
      validPasswordMatch ||
      validEmail ||
      validPhoneNumber
    ) {
      console.log("Invalid data");
      setMessage("");
      return;
    }

    try {
      const response = await axios.post("http://localhost:8000/register", {
        username: formData.username,
        password: formData.password,
        email: formData.email,
        phoneNumber: formData.phoneNumber,
      });
      setMessage(response.data.message);
      setFormData({
        username: "",
        password: "",
        confirmPassword: "",
        email: "",
        phoneNumber: "",
      });
      setValidUsername(false);
      setValidPassword(false);
      setValidPasswordMatch(false);
      setValidEmail(false);
      setValidPhoneNumber(false);
    } catch (error) {
      console.log(error.response.data);
      setMessage(error.response.data.detail);
    }
  };

  return (
    <div>
      <h1>User Registration</h1>
      <form className="form" onSubmit={handleSubmit}>
        <div>
          <label>Username:</label>
          <input
            type="text"
            name="username"
            value={formData.username}
            onChange={handleChange}
            required
          />
          {validUsername && (
            <p className="errormsg">Username must be at least 6 characters</p>
          )}
        </div>
        <div>
          <label>Password:</label>
          <input
            type="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            required
          />
          {validPassword && (
            <p className="errormsg">Password must be at least 6 characters</p>
          )}
        </div>
        <div>
          <label>Confirm Password:</label>
          <input
            type="password"
            name="confirmPassword"
            value={formData.confirmPassword}
            onChange={handleChange}
            required
          />
          {validPasswordMatch && (
            <p className="errormsg">Passwords do not match</p>
          )}
        </div>
        <div>
          <label>Email:</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
          />
          {validEmail && <p className="errormsg">Invalid email</p>}
        </div>
        <div>
          <label>Phone Number:</label>
          <input
            type="tel"
            name="phoneNumber"
            value={formData.phoneNumber}
            onChange={handleChange}
            required
          />
          {validPhoneNumber && (
            <p className="errormsg">Phone number must be 11 digits</p>
          )}
        </div>
        <button type="submit">Register</button>
      </form>
      {message && <p className="successmsg">{message}</p>}
    </div>
  );
};

export default App;
